import React, { Component } from 'react'
import { BrowserRouter } from 'react-router-dom'
import Navbar from './Navbar'
import Footer from './Footer'

export default class App extends Component {
  render() {
    return (
      <BrowserRouter>
      <Navbar/>
      <Footer/>
      </BrowserRouter>
    )
  }
}
